import React from 'react'
import PropType from 'prop-types'

const Login = ({OnClick}) =>(
	<form>
		<label>
			UserName:
			<input type='text' name='username'/>
		</label>
		<input type='submit' value="Login"/>
	</form>
);


export default Login;
